Model.P:
SimEnd = evalin('base','SimEnd');
Kp_cc = evalin('base',paramCtrl.Kp_cc);
CC_EN = 1;
Kp_ccMod = Kp_cc;

scopes = find_system(gcs, 'BlockType', 'Scope');  

for i=1:length(scopes)      
  set_param(scopes{i},'open','off');  
end

Object.P:
% switch modVers
%     case 'v3.1'
%        
evalin('base', ['param=loadGalvoParam(' strrep(modVers(2:end-1),'.','') ')'])

switch modVers(1:2)
    case 'v4'
                JR=evalin('base','param.JR');
                KMT=evalin('base','param.KMT');
                Rc=evalin('base','param.Rc');
                Lc=evalin('base','param.Lc');
                KFR=evalin('base','param.KFR');
                KTB=evalin('base','param.KTB');
                KBM=evalin('base','param.KBM');
                Rsh=evalin('base','param.Rsh');
    case 'v3'

                RIN=evalin('base','param.RIN');
                TRC=evalin('base','param.TRC');
                CR=evalin('base','param.CR');
                CL=evalin('base','param.CL');
                FR=evalin('base','param.FR');
                KTR=evalin('base','param.KTR');
                BEM=evalin('base','param.BEM');
                SHR=evalin('base','param.SHR');
    otherwise

end

set_param(gcb, 'OverrideUsingVariant',sprintf('Galvo_%s',strrep(modVers,'.','')))

str=sprintf('%s',get(gcbh,'ModelName'));
port_label('input', 1, 'VCoil','texmode','on')
color('blue');
port_label('output', 1, 'VShunt','texmode','on')
color('black');
port_label('output', 2, 'AngPos')
%text(.05,.98,['{\fontsize{12}\it\bf' strrep(str,'_',' ') '}'],'horizontalAlignment','left','verticalAlignment','top','texmode','on')
text(.015,.98,['{\fontsize{12}\it\bf' strrep(str,'_','\_') '}'],'horizontalAlignment','left','verticalAlignment','top','texmode','on')

Annotation.P:
an = getCallbackAnnotation; 
switch CC_EN
   case 1
        an.Text='Current controller OFF';
        CC_EN = 0;
        Kp_ccMod = 1;
        set_param('Galvo_sys_v11/EN_cc','Commented','on')
   case 0
        an.Text='Current controller ON';
        CC_EN = 1;
        set_param('Galvo_sys_v11/EN_cc','Commented','off')
end
Kp_ccMod = Kp_cc*CC_EN;
%sprintf(an.Text)

an = getCallbackAnnotation; 
str=get_param(gcs,an.Text);
re=strsplit(str,';');

for k=1:length(re)
    if ~isempty(re{k})
        eval(re{k});
    end
end

an = getCallbackAnnotation; 
str=get_param(gcs,an.Text);
re=strsplit(str,';');

for k=1:length(re)
    if ~isempty(re{k})
        eval(re{k});
    end
end
